        <input type="text" placeholder="Search.." />
        <button type="submit">Search<i class="fa fa-shopping-cart"></i></button>
        <img src="Logoimg/Sidelogo.jpg" alt="BigCo Inc. logo" width="600px" height="80px" />
      </div>
        </>
        
    )
}

export default Header;
